import styled from 'styled-components';
import React from 'react';
import Search from '../atoms/searchinput';
import Buttons from '../atoms/button';

const Inheader = styled.div`
  display: flex;
  -webkit-box-align: center;
  align-items: center;
`;

const Issueheader = styled.h2``;

const Inheaders = (props) => {

return (
    <Inheader>
        <Issueheader>Issue</Issueheader>
        <Search type="input" placeholder="Issue名で検索"/>
        <Buttons  background="rgb(66, 195, 96)" color="white" border-bottom="2px solid rgb(40, 167, 69)" hover_back="rgb(40, 167, 69)" onClick={() => props.open} >
          New
        </Buttons>
        <Buttons  background="rgb(215, 58, 73)" color="white" border-bottom="2px solid rgb(175, 28, 42)" onClick={() => props.delete}>
          Delete
        </Buttons>
    </Inheader>
    )

}

export default Inheaders
